import { moduleMetadata } from '@storybook/angular';
import { ImageModule } from 'primeng/image';
import { LogoComponent } from './logo.component';
const meta = {
    title: 'Components/Logo',
    component: LogoComponent,
    tags: ['autodocs'],
    decorators: [moduleMetadata({ imports: [ImageModule] })],
    argTypes: {
        wrapperClassNames: { description: 'Custom CSS classes as component wraps' },
        href: { description: 'Link url', type: 'string' },
        src: { description: 'Image source path' },
        alt: { description: 'Alternative text' },
        classNames: { description: 'Custom CSS classes' },
        handleClick: { description: 'Function for handle routing for [href] value' },
    },
    parameters: {
        docs: {
            description: {
                component: `Wrapper component that uses [PrimeNg Image](https://www.primefaces.org/primeng/image) 
							for render the Project Logo.<br>
							This component handle the routing path (internal or external) by 
							itself in relation of the **[href]** value.`,
            }
        },
    },
};
export default meta;
export const _LogoComponent = {
    args: {
        wrapperClassNames: '',
        classNames: '',
        src: 'https://www.wiz-team.com/wp-content/uploads/2020/05/WIZ_TEAM_LOGO_TONAL_MAIN_RGB_SMALL-1.png',
        alt: 'Wiz Team',
        href: 'https://www.wiz-team.com'
    },
};
